import React from 'react';
import NavBar from '../NavBar/NavBar';
import Footer from '../Footer/Footer';
import './About.scss';

export default function About() {
    return (
        <div className="about">
            <NavBar />
                <div className="about__details">
                    <p>About</p>
                    <span className="about__details-message">We simply believe that plant lives matter.</span>
                </div>
            <Footer />
        </div>
    )
}
